import React, { Component } from 'react';
import './App.css';
import {BrowserRouter as Router} from 'react-router-dom';
import {Route,Redirect} from 'react-router';
import AdminLogin from './components/adminlogin/AdminLogin';
import Verfication from './components/verification/Verification';
import DeveloperLogin from './components/developerlogin/DeveloperLogin';
import DeveloperDetails from './components/details_for_developer/DetailsDeveloper';
import AdminDasboard from './components/admin_dashboard/AdminDashboard';
import Axios from 'axios';
import url from './components/url';


class App extends Component {
  constructor(){
    super();
    this.state={user:null};
    Axios.get(`http://localhost:3002/user`).then(res=>{
      if(res.status===200)
        this.setState({user:1});
      else
        this.setState({user:null})
    })
  }

  render() {

    if(this.state.user){
          return (
            <Router>
              <div>
                <switch>
                  <Route path='/adminlogin' component={AdminLogin}/>
                  <Route path="/verification/:email" component={Verfication}/>
                  <Route path="/developers_login" component={DeveloperLogin}/>
                  <Route path="/developers_details/:email" component={DeveloperDetails}/>
                  <Route path="/admindashboard" component={AdminDasboard}/>
                </switch>
                <Redirect to="/admindashboard"/>
              </div>
            </Router>
              )
          }
    else{
      return(
        <Router>
        <div>
        <switch>
          <Route path='/adminlogin' component={AdminLogin}/>
          <Route path="/verification/:email" component={Verfication}/>
          <Route path="/developers_login" component={DeveloperLogin}/>
          <Route path="/developers_details/:email" component={DeveloperDetails}/>
          <Route path="/admindashboard" component={AdminDasboard}/>
        </switch>
        <Redirect to="/adminlogin"/>
      </div>
    </Router>
      )
    }
  }
}
export default App;
